BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "_bays_desc" (
	"KerbsideID"	INTEGER,
	"RoadSegmentDescription"	TEXT,
	PRIMARY KEY("KerbsideID")
);
CREATE TABLE IF NOT EXISTS "_zone_desc" (
	"ParkingZone"	INT,
	"segment_desc"	
);
CREATE TABLE IF NOT EXISTS "on_street_parking" (
	"KerbsideID"	INTEGER,
	"Lastupdated"	TEXT,
	"Status_Timestamp"	TEXT,
	"Zone_Number"	INTEGER,
	"Status_Description"	TEXT,
	"Location"	TEXT,
	"Latitude"	REAL,
	"Longitude"	REAL,
	"RoadSegmentDescription"	TEXT,
	PRIMARY KEY("KerbsideID"),
	FOREIGN KEY("Zone_Number") REFERENCES "parking_zones"("ParkingZone")
);
CREATE TABLE IF NOT EXISTS "parking_zones" (
	"ParkingZone"	INTEGER,
	PRIMARY KEY("ParkingZone")
);
CREATE TABLE IF NOT EXISTS "sign_plates" (
	"sign_plate_id"	INTEGER,
	"ParkingZone"	INTEGER,
	"Restriction_Days"	TEXT,
	"Time_Restrictions_Start"	TEXT,
	"Time_Restrictions_Finish"	TEXT,
	"Restriction_Display"	TEXT,
	PRIMARY KEY("sign_plate_id" AUTOINCREMENT),
	FOREIGN KEY("ParkingZone") REFERENCES "parking_zones"("ParkingZone")
);
CREATE TABLE IF NOT EXISTS "zone_segments" (
	"zone_segment_id"	INTEGER,
	"ParkingZone"	INTEGER NOT NULL,
	"OnStreet"	TEXT,
	"StreetFrom"	TEXT,
	"StreetTo"	TEXT,
	"Segment_ID"	TEXT,
	PRIMARY KEY("zone_segment_id" AUTOINCREMENT),
	FOREIGN KEY("ParkingZone") REFERENCES "parking_zones"("ParkingZone")
);
COMMIT;
